package com.methods;

public class EvenSeries {
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("The Even Numbers between 121 To 229 are");
				for(int i=121;i<=229;i++)
				{
					if(i%2==0)
						System.out.println(i);
				}
			}
	}


